import React from 'react'
import CuerpoFeedBox from '../components/CuerpoFeedBox'

function CuerpoFeed(props) {
    return(
        <div className="col-12">
                          {
                              props.dClips.map((dClips) => {
                                  return(
                                  <CuerpoFeedBox embedClip={dClips.embed_url} thumbClip={dClips.thumbnail_url} titleClip={dClips.title} urlClip={dClips.url} countClip={dClips.view_count} />
                                  )
                              })
                          }
                     </div>
    )
}x
export default CuerpoFeed
